import axios from "axios";

export class PersonaService{
    baseUrl="http://localhost:30902/api"
    getAll(){
        return axios.get(this.baseUrl+"/usuario?page=0&size=5&sort=username,asc&search=").then(res => res.meta).then((responseData) => {
            this.setState({products:responseData})
            console.log("Console log de products responseData");
            console.log(responseData);
        })
        .catch(function(e) {
            console.log(e);
        })
    }
}
